import random
import requests
import io
import base64
import tkinter as tk
from PIL import Image, ImageTk

root = tk.Tk()
root.withdraw()  # Hide the main window

def create_window():
    x = random.randint(0, root.winfo_screenwidth() - 256)
    y = random.randint(0, root.winfo_screenheight() - 256)

    # Set the image data
    image_data_base64 = base64.b64decode("")

    # Open the image
    image = Image.open(io.BytesIO(image_data_base64))
    photo = ImageTk.PhotoImage(image)

    # Create a custom message box with an image
    custom_box = tk.Toplevel(root)
    custom_box.geometry("+%d+%d" % (x, y))  # Set the position of the custom message box
    custom_box.title("Custom Message Box")
    label = tk.Label(custom_box, text="Fuiste")
    label.pack()
    image_label = tk.Label(custom_box, image=photo)
    image_label.pack()
    custom_box.focus_set()
    custom_box.grab_set()

    # When the window is closed, create two new windows
    custom_box.protocol("WM_DELETE_WINDOW", lambda: (create_window(), create_window()))

    custom_box.wait_window()

# Create the first window
create_window()

root.mainloop()